import React from "react";


const FollowerCard = props => {

  return (
    <div className="follower-card">
      <h1>Github Handle: {props.name}</h1>
      <img 
        src={props.src} 
        width="30%" 
        alt="My Avatar">
      </img>
      <p> Total Followers: {props.followers}</p>
      <p>Total Repos: {props.files}</p>
      <a className="" href={props.github}/>
      Github Handle
    </div>
  )
}
export default FollowerCard;
